import React from 'react';
import PropTypes from "prop-types";

const foodILike = [ 
  {
    id:1,
    name: "Kimchi",
    image: "https://www.ghostfreshmart.com/wp-content/uploads/2020/04/%EB%A7%89%EA%B9%80%EC%B9%98.jpg",
    rating:7
  },
  {
    id:2,
    name: "3gs",
    rating:8,
    image: "data:image/jpeg;base64,"
  },
  {
    id:3,
    name: "gamjatang",
    rating:10,
    image: "data:image/jpeg;base64,"
  },
  {
    id:4,
    name: "jokbal",
    rating:6,
    image: "data:image/jpeg;base64,"

  }
]

function Food({name, picture, rating}) {
  // console.log(props)
  return (
  <div>
    <h2>I love {name}</h2>
    <h4>{rating}/10.0</h4>
    <img src = {picture} alt={name} />
  </div>);
}
Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture:PropTypes.string.isRequired,
  rating:PropTypes.number.isRequired
};
function renderFood(dish) {
  return <Food name = {dish.name} picture ={dish.image} />;
}
function App() {
  return (
    <div> 
      {console.log(foodILike.map(renderFood))}
      {foodILike.map(dish => (
         <Food key = {dish.id} 
         name = {dish.name} 
         picture ={dish.image}
         rating = {dish.rating} /> 
      ))}
    </div>
  );
}

export default App;
